import React, { useState } from 'react';
import './output.css';
import './App.css';
import { Link, useParams, useLocation } from "react-router-dom";
import './Sidebar.css';

const Sidebar = ({ user, onLogout }) => {
  const [isCollapsed, setIsCollapsed] = useState(false);
  const { username } = useParams();
  const location = useLocation();

  const baseUrl = `/${username}`;

  const isActive = (path) => {
    return location.pathname === path;
  };

  const menuItems = [
    {
      path: `/${user?.username}`,
      icon: '🏠',
      label: 'Dashboard',
      description: 'Your personal space'
    },
    {
      path: `/${user?.username}/entry`,
      icon: '📝',
      label: 'My Journals',
      description: 'Write and manage entries'
    },
    {
      path: `/${user?.username}/insights`,
      icon: '📊',
      label: 'Insights',
      description: 'Analytics & progress'
    },
    {
      path: '/community',
      icon: '🏘️',
      label: 'Community',
      description: 'Connect with others'
    },
    {
      path: `/${user?.username}/affirmations`,
      icon: '✨',
      label: 'Affirmations',
      description: 'Daily positive thoughts'
    },
    {
      path: `/${user?.username}/manifestations`,
      icon: '🌟',
      label: 'Manifestations',
      description: 'Dreams & goals'
    },
    {
      path: '/features',
      icon: '🚀',
      label: 'Features',
      description: 'App capabilities'
    },
    {
      path: '/contact',
      icon: '📞',
      label: 'Contact',
      description: 'Get in touch'
    }
  ];

  return (
    <div className={`sidebar ${isCollapsed ? 'collapsed' : ''}`}>
      <div className="sidebar-header">
        <div className="sidebar-logo">
          <span className="logo-icon">🌸</span>
          {!isCollapsed && (
            <span className="logo-text font-handwriting">SafeSpace</span>
          )}
        </div>
        <button 
          className="collapse-btn"
          onClick={() => setIsCollapsed(!isCollapsed)}
          title={isCollapsed ? 'Expand' : 'Collapse'}
        >
          <span className={`collapse-icon ${isCollapsed ? 'expanded' : ''}`}>
            {isCollapsed ? '→' : '←'}
          </span>
        </button>
      </div>

      {user && (
        <div className="user-profile">
          <div className="user-avatar">
            {user.profilePicture ? (
              <img
                src={user.profilePicture}
                alt={user.username}
                className="h-12 w-12 rounded-full mx-auto border-2 border-pink-300"
              />
            ) : (
              <div className="h-12 w-12 rounded-full bg-gradient-to-r from-pink-300 to-green-300 flex items-center justify-center text-pink-700 font-bold text-lg mx-auto border-2 border-pink-300">
                {user.username.charAt(0).toUpperCase()}
              </div>
            )}
          </div>
          {!isCollapsed && (
            <div className="user-info">
              <h3 className="user-name font-handwriting">{user.username}</h3>
              <div className="user-stats">
                <span className="stat">
                  <span className="stat-icon">⭐</span>
                  {user.points || 0}
                </span>
                <span className="stat">
                  <span className="stat-icon">🔥</span>
                  {user.streak || 0}
                </span>
              </div>
              
            </div>
          )}
        </div>
      )}
      <div className="level-progress">
                <div className="level-info">
                  <span className="level-text">Level {user.level || 1}</span>
                  <span className="progress-text">{user.progressToNextLevel || 0}%</span>
                </div>
                <div className="progress-bar">
                  <div 
                    className="progress-fill"
                    style={{ width: `${user.progressToNextLevel || 0}%` }}
                  ></div>
                </div>
              </div>

      <nav className="sidebar-nav">
        <ul className="nav-list">
          {menuItems.map((item, index) => (
            <li key={index} className="nav-item">
              <Link
                to={item.path}
                className={`nav-link ${isActive(item.path) ? 'active' : ''}`}
                title={isCollapsed ? item.label : ''}
              >
                <span className="nav-icon">{item.icon}</span>
                {!isCollapsed && (
                  <div className="nav-content">
                    <span className="nav-label">{item.label}</span>
                    <span className="nav-description">{item.description}</span>
                  </div>
                )}
                {isActive(item.path) && (
                  <div className="active-indicator"></div>
                )}
              </Link>
            </li>
          ))}
        </ul>
      </nav>

      {user && (
        <div className="sidebar-footer">
          <button 
            onClick={onLogout}
            className="logout-btn"
            title={isCollapsed ? 'Logout' : ''}
          >
            <span className="logout-icon">🚪</span>
            {!isCollapsed && <span className="logout-text">Logout</span>}
          </button>
        </div>
      )}

      <div className="sidebar-decoration">
        <div className="decoration-circle circle-1"></div>
        <div className="decoration-circle circle-2"></div>
        <div className="decoration-circle circle-3"></div>
      </div>
    </div>
  );
};

export default Sidebar;
